import React from 'react';
import './Navbar.css';


function Nav() {
  return (
    <div>
        <div className='navbar'>
        
           <ul>
            <li><a href="">Resturant</a></li>
            <li>Kids</li>
            <li>Tech</li>
            <li>Food</li>
            <li>Home</li>
            </ul> 
            
            
            
        </div>
        
        
    </div>
  );
}

export default Nav;
